import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar=()=>{
    return (
        <div id='nav'>
            <NavLink className='nav-item' to='/home'>
                <img src='../assets/images/logo-white.png' alt='logo-white'></img>
                <img src='../assets/images/HiberSenseWhite_Logo.png' alt='hibersense white logo'></img>
            </NavLink>
            <NavLink className='nav-item' to='/summary'>Summary</NavLink>
            <NavLink className='nav-item' to='/rooms'>Rooms</NavLink>
        </div>
    )
}


export default Navbar;
